def minSkew(string):
    skew = []
    value = 0
    for i in range (0,len(string)+1):
        skew.append(0)
    for i in range (0,len(string)):
        if (string[i] == "G"):
            value = value+1    
        elif (string[i] == "C"):
            value = value-1 
        else:
            value = value
        skew[i+1] = value

    minValue = min(skew)
    minList = []
    
    for j in range (0,len(skew)):
        if skew[j] == minValue:
            minList.append(j)
    
    minListString = ' '.join(str(x) for x in minList)
    return minListString

